import styled from 'styled-components';

// eslint-disable-next-line import/prefer-default-export
export const Tabs = styled.div`
  display: flex;
  flex-direction: row;

  max-width: 676px;
  overflow-x: hidden;

  padding: 0 11px;
  margin-left: -4px;

  height: 34px;
`;
